import {React, useState} from 'react';

export default props => {
    const [nome, setNome] = useState('fds');

    function sendValueInput(e) {
        setNome = e.target.value;
    }

    return (
        <>
            <input className="input" value={nome} onChange={sendValueInput}/>
        </>
    )
}
